import * as React from 'react';
import { StyleSheet } from 'react-native';
import { Link } from '@react-navigation/native';
import { TextInput, Button } from 'react-native-paper';

import { Text, View } from '../components/Themed';

export default function Login({navigation}) {
  const onPressDoLogin = () => {
    console.log('Send query...')
  }
  return (
    <View style={styles.container}>
      <Text style={styles.title}>Get Onboard</Text>
      <TextInput
        label="Email"
        value={''}
        onChangeText={() => console.log('typing username...')}
      />
      <TextInput
        secureTextEntry={true}
        label="Password"
        value={''}
        onChangeText={() => console.log('typing password...')}
      />
      <Button
        mode="contained"
        onPress={onPressDoLogin}
        accessibilityLabel="LogIn"
      >
        Log in
      </Button>
      <Text onPress={() => navigation.navigate('Register')}>Register your account</Text>
    </View>

  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
  },

  separator: {
    marginVertical: 30,
    height: 1,
    width: '80%',
  },
});
